import React, { Component } from 'react';
import './App.css';
import Blog from './Blog';
import Collect from './Collect';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

import { BrowserRouter } from 'react-router-dom';



class App extends Component {


  render() {
    return (
      <div className="App">
        <div className='logo'>

          <strong className='text'> <h1>Active GYM</h1></strong>

        </div>
        <div>
        <Router>
        <div>
          <h2>Welcome to React Router Tutorial</h2>
          <nav className="navbar navbar-expand-lg navbar-light bg-light">
          <ul className="navbar-nav mr-auto">
            <li><Link to={'/'} className="nav-link"> Home </Link></li>
            <li><Link to={'/collect'} className="nav-link">Collect</Link></li>
            <li><Link to={'/notification'} className="nav-link">Notification</Link></li>
          </ul>
          </nav>
          <hr />
          <Switch>
              <Route exact path='/' component={Home} />
              <Route path='/contact' component={Collect} />
              <Route path='/about' component={Blog} />
          </Switch>
        </div>
      </Router>
      </div>
      </div>
    );
  }
}

export default App;
